import React from 'react';
import { Line } from 'react-chartjs-2';
import 'chart.js/auto';

const TestChart = () => {
  const data = {
    labels: ['Entry', 'Exit'],
    datasets: [
      {
        label: 'AAPL',
        data: [150, 160],
        borderColor: 'rgba(75,192,192,1)',
        fill: false,
      },
    ],
  };

  return <Line data={data} />;
};

export default TestChart;
